Este soneto pertenece a Luis de Góngora, poeta español del Siglo de Oro que vivió entre 1561 y 1627. Es un soneto de temática religiosa dedicado a la Virgen María, utilizando el estilo culterano característico de Góngora, con abundantes metáforas y referencias mitológicas.
